import React, { Component } from 'react'

class Cardlist extends Component {
  monsters = this.props.monsters
  render() {
    return (
      <div>
        {this.monsters.map((monster) => (
          <h1 key={monster.id}>{monster.name}</h1>
        ))}
      </div>
    )
  }
}

export default Cardlist
